(1, 'Rapor Standar (Restored)', 'rapor', '<h3 style=\"text-align:center\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:12px\"><img src=\"data:image/png;base64,\" style=\"height:57px; width:60px\" /></span></span></h3>\n\n<h3 style=\"text-align:center\">&nbsp;</h3>\n\n<h3 style=\"text-align:center\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><strong>LAPORAN HASIL BELAJAR (RAPOR)</strong></span></span></h3>\n\n<p>&nbsp;</p>\n<!-- Identitas Siswa -->\n\n<table cellspacing=\"0\" style=\"border-collapse:collapse; border:none; font-size:12px; margin-bottom:10px; width:100%\">\n	<tbody>\n		<tr>\n			<td style=\"width:15%\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Nama</span></span></td>\n			<td style=\"width:2%\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">:</span></span></td>\n			<td style=\"width:38%\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><strong>[[NAMA_SISWA]]</strong></span></span></td>\n			<td style=\"width:15%\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Kelas</span></span></td>\n			<td style=\"width:2%\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">:</span></span></td>\n			<td style=\"width:28%\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">[[KELAS]]</span></span></td>\n		</tr>\n		<tr>\n			<td><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Nomor Induk</span></span></td>\n			<td><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">:</span></span></td>\n			<td><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">[[NIS]]</span></span></td>\n			<td><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Tahun Pelajaran</span></span></td>\n			<td><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">:</span></span></td>\n			<td><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">[[TAHUN_AJARAN]]</span></span></td>\n		</tr>\n		<tr>\n			<td><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Nama MDT. Ula</span></span></td>\n			<td><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">:</span></span></td>\n			<td><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">[[NAMA_SEKOLAH]]</span></span></td>\n			<td><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Alamat</span></span></td>\n			<td><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">:</span></span></td>\n			<td>[[ALAMAT_SISWA]]</td>\n		</tr>\n	</tbody>\n</table>\n\n<hr /><!-- A. Pengetahuan dan Keterampilan -->\n<h4 style=\"margin-left:0; margin-right:0\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">A. Pengetahuan dan Keterampilan</span></span></h4>\n\n<div style=\"font-size:12px\">[[TABEL_NILAI]]</div>\n<!-- B. Ekstrakurikuler -->\n\n<h4 style=\"margin-left:0; margin-right:0\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">B. Ekstrakurikuler</span></span></h4>\n\n<div style=\"font-size:12px\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">[[TABEL_EKSKUL]]</span></span></div>\n<!-- C. Prestasi -->\n\n<h4 style=\"margin-left:0; margin-right:0\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">C. Prestasi</span></span></h4>\n\n<div style=\"font-size:12px\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">[[TABEL_PRESTASI]]</span></span></div>\n<!-- D & E Container -->\n\n<table cellspacing=\"0\" style=\"border-collapse:collapse; border:none; font-size:12px; width:100%\">\n	<tbody>\n		<tr>\n			<td style=\"vertical-align:top; width:48%\">\n			<h4 style=\"margin-left:0; margin-right:0\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">D. Kepribadian</span></span></h4>\n			<span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">[[TABEL_KEPRIBADIAN]]</span></span></td>\n			<td style=\"width:4%\">&nbsp;</td>\n			<td style=\"vertical-align:top; width:48%\">\n			<h4 style=\"margin-left:0; margin-right:0\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">E. Ketidakhadiran</span></span></h4>\n			<span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">[[TABEL_KETIDAKHADIRAN]]</span></span></td>\n		</tr>\n	</tbody>\n</table>\n\n<p><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">F. Catatan Wali Kelas (Akhir Tahun)</span></span></p>\n<!-- F. Catatan Wali Kelas -->\n\n<div style=\"border:1px solid #000000; font-size:12px; font-style:italic; min-height:40px; padding:10px; text-align:center\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">&quot;[[CATATAN_WALI]]&quot;</span></span></div>\n<!-- Keputusan Kenaikan -->\n\n<div style=\"border:1px solid #000000; font-size:12px; margin-top:10px; padding:15px; text-align:center\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Berdasarkan hasil penilaian, Peserta Didik dinyatakan:<br />\n<strong>[[STATUS_KENAIKAN]]</strong></span></span></div>\n\n<p style=\"text-align:right\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Bangkalan, [[TANGGAL_RAPOR]]</span></span></p>\n<!-- Tanda Tangan -->\n\n<table style=\"border:none; font-size:12px; margin-top:20px; width:100%\">\n	<tbody>\n		<tr>\n			<td style=\"text-align:center; vertical-align:top; width:30